import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
/*https://api.giphy.com/v1/gifs/search?api_key=DbXQWofnhyYMNBO9AupFJW7CO4V3MBZE&q=panda&limit=100&offset=0&rating=g&lang=en*/
function App() {
  const [value, updateValue] = useState(['https://media.giphy.com/media/fqu03zSFQEToVmw3qi/giphy.gif']);

  return (
    <div className="App">
       <section className="App-content">
         <img src={value} />
       </section >
    </div>
  );
}

export default App;
